import React from "react";
import { Text, View } from "react-native";

const tripMembersScreen = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Text>Hello, world! tripMembersScreen</Text>
    </View>
  );
};
export default tripMembersScreen;
